css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("docs.asp.net") {
  
  .wy-nav-side {
    background-color: #114;
  }
  
  .wy-menu-vertical a {
    background-color: #114;
  }
  
  .wy-menu-vertical a:hover, .wy-menu-vertical li.current a:hover, .wy-menu-vertical a:hover span.toctree-expand, .wy-menu-vertical li.toctree-l2 a:hover span.toctree-expand, .wy-menu-vertical li.toctree-l3 > a:hover, .wy-menu-vertical li.toctree-l3.current > a:hover, .wy-menu-vertical li.toctree-l4 > a:hover, .wy-menu-vertical li.toctree-l4.current > a:hover {
    
  }
  
  .rst-content h1, .rst-content h1 .headerlink {color: #aaa}
  p {color: #888}
  
  .wy-nav-content-wrap  {
    background-color: #111;
  }
  
  .wy-nav-content {
    background-color: #111;
  }
  
  pre {
    background-color: #222;
  }
  
  .pre {
    background-color: #222;
  }
  
  .docutils.literal {
    background-color: #222;
    border: 1px solid #333;
  }
  
  .rst-content .admonition {
    background-color: #222;
  }
  
  .codeblock, pre.literal-block, .rst-content .literal-block, .rst-content pre.literal-block, div[class^="highlight"] {
    background-color: #333;
  }
  
  .hll {background-color: #440}
  .n {color: gray}
  .p {color: gray}
  .k {color: gray}
  .nc {color: gray}
  .nn {color: gray}
  
}
